package hou.text;

import java.io.IOException;

import org.jsoup.Jsoup;
import org.jsoup.nodes.Document;
import org.jsoup.nodes.Element;
import org.jsoup.select.Elements;

/**
 * @author houweitao
 * @date 2015年12月22日 下午4:33:11
 * @to 验证百度贴吧搜索有无验证码
 */

public class TestBaiduSearch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TestBaiduSearch tbs = new TestBaiduSearch();
		tbs.begin();
	}

	public void begin() {
		final String url = "http://tieba.baidu.com/f/search/res?ie=utf-8&kw=&qw=%E9%82%AF%E5%B1%B1%E5%8C%BA&un=&isnew=1&only_thread=1&pn=1&rn=50&sm=1";

		for (int i = 0; i < 20; i++) {
			new Thread(new Runnable() {

				// while (!notCrawlurlSet.isEmpty()) {

				public void run() {
					// while (true) {
					while (true) {

						System.out.println("当前进入" + Thread.currentThread().getName());
						// String tmp = getAUrl();
						try {
							crawler(url);
						} catch (Exception e) {
							e.printStackTrace();
							e.printStackTrace();
						}
					}
				}
			}, "thread-" + i).start();
		}
	}

	public void crawler(String url) {
		System.out.println("########Fetching:" + url);
		Document doc;
		try {
			doc = Jsoup.connect(url).followRedirects(true).timeout(10000)
					.userAgent("Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.0)").get();

			Elements links = doc.select("div.s_post").select(".p_title").select("a[href]");

			for (Element link : links) {
				System.out.println(link.text() + "  " );
			}
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
}



